const icon = 'data:image/svg+xml;base64,';
const ArgumentType = require('../../extension-support/argument-type');
const BlockType = require('../../extension-support/block-type');
const Variable = require('../../engine/variable');
const formatMessage = require('format-message');
const Cast = require('../../util/cast.js');

var distanceValue;
var result;



class Scratch3TSP
{
    constructor (runtime)
    {
        this.runtime = runtime;
    }

    getInfo ()
    {

        return {
            id: 'tsp',
            name: formatMessage({
                id: 'tsp',
                default: 'TSP',
                description: 'Solves Travelling Salesman Problem using different techniques'
            }),
            menuIconURI: icon,
            blockIconURI: icon,

            color1: '#615bd7',
            color2: '#9c98e6',
            color3: '#1d1967',

            blocks: [
                {
                    id: 'TSP.Command',
                    opcode: 'command',
                    blockType: BlockType.COMMAND,
                    description: 'runs the operation',
                    text: 'Destinations [D_TEXT] Algorithm [Algo] Result [B_Path]',
                    arguments:
                    {
                        D_TEXT:
                        {
                            type: ArgumentType.LIST,
                        },
                        B_Path:
                        {
                            type: ArgumentType.STRING,
                            defaultValue: 'Name'
                        },
                        Algo:
                        {
                            type: ArgumentType.STRING,
                            menu: 'algo_names'
                        },
                    }
                },
                {
                    id: 'TSP.Simulation',
                    opcode: 'simulation',
                    blockType: BlockType.COMMAND,
                    description: 'runs the operation',
                    text: 'Simulate [D_TEXT] Algorithm [Algo]',
                    arguments:
                    {
                        D_TEXT:
                        {
                            type: ArgumentType.LIST,
                        },
                        Algo:
                        {
                            type: ArgumentType.STRING,
                            menu: 'algo_names'
                        },
                    }
                },
                {
                    id: 'TSP.Distance',
                    opcode: 'getDistance',
                    blockType: BlockType.REPORTER,
                    description: 'runs the operation',
                    text: 'Total Distance',
                    defaultValue: '0',
                },
            ],
            menus: {
                algo_names: {
                    items: ['Brute Force', 'Simulated annealing', 'Branch and bound']
                }
            },
        };
    }
    command(args, util)
    {
        
        flag = args.Algo;
        var text = args.D_TEXT;

        if (text == undefined)
        {
            return 'Destinations Undefined'
        }
        else if (text.length > 2)
        {
            //To get rid of characters keeping just numbers, dots
            // text = text.replace(/[^0-9 .,]/g, '');
            text = text.replace(/[^0-9 -.]/g, '');

            //Comparing the characters and indexes if both match, means that single digit values are given
            //Separated after every single value

            //Otherwise, double digit values are given,
            //which can be separated when a whitespace is found
            temp = text.split(' ');
            if (temp.length == 1 &&  text.length != 1)
            {
                text = text.split('');
            }
            else
            {
                text = text.split(' ');
            }

            // let results = text.map(i=>Number(i));
            // const nodes = [];

            // for (let i = 0; i < results.length; i += 2) {
            //     const x = results[i];
            //     const y = results[i + 1];
            //     nodes.push({ x, y });
            // }
            

            let assetData;
            try
            {
                //Array and Number of destinations are passed to the Algorithm
                if (args.Algo == 'Brute Force')
                {
                    
                    assetData = require('./brute_force.js');
                    result = assetData.bruteForceTSP(text);
                    bestPath = result.bestPath.map(item => item + 1);
                    distanceValue = result.totalDistance;
                }
                else if (args.Algo == 'Simulated annealing')
                {
                    
                    assetData = require('./annealing.js');
                    const result = assetData.simulatedAnnealing(text);
                    bestPath = result.bestPath;
                    distanceValue = result.totalDistance;
                }
                else if (args.Algo == 'Branch and bound')
                {
                    
                    // // Usage example
                    // var inputCoordinates = [-113, -120, -200, 145, 0, 0, 199, -102, -210, -160];
                    // var result = solveBranchAndBound(inputCoordinates);
                    // console.log("Best Path:", result.path);
                    // console.log("Distance:", result.distance);

                    assetData = require('./branchandbound.js');
                    const result = assetData.solveBranchAndBound(text);
                    bestPath = result.bestPath;
                    distanceValue = result.totalDistance;
                }

                //The name of the given list (as an input) is stored,
                //so we can find the list using the build-in function
                list_name = args.B_Path;

                list = util.target.lookupVariableByNameAndType(list_name, Variable.LIST_TYPE);
                if (list)
                {
                    for(var i = 0; i < bestPath.length; i++)
                    {
                        list.value.push(bestPath[i]);
                        list._monitorUpToDate = true;
                    }
                }
                else
                {
                    return 'Result List Error';
                }


            } catch (e) 
            {
                console.log(e);
                // Catch Problems and output to console if needed
            }
        }

    }
    simulation (args, util)
    {
        var text = args.D_TEXT;
        if (text == undefined)
        {
            return 'Destinations Undefined'
        }
        else if (text.length > 2)
        {
            text = text.replace(/[^0-9 -.]/g, '');
            temp = text.split(' ');
            if (temp.length == 1 &&  text.length != 1)
            {
                text = text.split('');
            }
            else
            {
                text = text.split(' ');
            }
            var result = text.map(i=>Number(i));

            var stage = document.getElementsByClassName('gui_page-wrapper_r7IhT');
            var div;
            if(document.getElementById('tsp_viz') == undefined)
            {
                div = document.createElement('div');
                var btn = document.createElement('button');
                btn.textContent = 'Close';
                btn.onclick = function(){
                    div.remove();
                }
                btn.style.margin = '10px';
                var content = document.createElement('div');
                content.style.width = '100%';
                content.style.height = '100%';
                content.style.backgroundColor = 'white';
                var iframe = document.createElement('iframe');
            }
            else
            {
                div = document.getElementById('tsp_viz');
            }
            stage[0].appendChild(div);
            
            // const ids = [33, 44, -22, -65, 0, 0];
            const queryString = '?ids=' +  encodeURIComponent(JSON.stringify(result));
            if (args.Algo == 'Simulated annealing')
            {
                iframe.src = 'http://localhost:8082/annealing.html'+ queryString;
            } else if (args.Algo == 'Branch and bound')
            {
                iframe.src = 'http://localhost:8081/branch-and-bound.html'+ queryString;
            } else if (args.Algo == 'Brute Force')
            {
                iframe.src = 'http://localhost:8083/brute-force.html'+ queryString;
            }
            iframe.style.width = '100%';
            iframe.style.height = '100%';
            content.appendChild(iframe);
            div.id = 'tsp_viz';
            div.style.position = 'absolute';
            div.style.width = '60%';
            div.style.height = '65%';
            div.style.zIndex = '1000';
            div.style.backgroundColor = 'red';
            div.style.top = '10%';
            div.style.left = '15%';
            div.style.borderRadius = '10px';
            div.appendChild(btn);
            div.appendChild(content);
                
        }
        
    }

    getDistance()
    {
        if (distanceValue){
            return distanceValue;
        }
        return 0;
    }

}

module.exports = Scratch3TSP;